    <div className="App">
      <h1>Hello CodeSandbox</h1>
      <div style={{  overflow: "scroll", display: "flex" }}>
        {map(range(10), (_) => (
          <Container />
        ))}
      </div>
    </div>
  );
};

const Container = () => {
  return (
    <div style={{ height: "2300px", width: "514px", margin: "16px" }}>
      <div style={{ height: "100%", width: "514px" }}>Hello</div>
    </div>
  );
};

export default Pagination;
